/**
inline styles that should be loaded ahead of the rest of the application
 */
body {
	overflow-y: hidden;
}

@media (max-width: 600px) {
	.redirect-message #connectMsg {
		display: none;
	}
}

.none {
	display: none;
}

#load-error {
	background: #fff;
	float: none;
	position: relative;
	padding: 1% 1%;
	height: calc(100%);
}

#load-error .close-tab-message {
	text-align: center;
	margin: auto auto 2em auto;
	width: 50%;
	padding: 10px;
	border: 2px solid #ccc;
}

#load-error .load-error-message {
	margin: auto;
	width: 50%;
	padding: 10px;
	border: 2px solid #ccc;
}

#load-error .retry-link {
	text-decoration: underline;
}

#load-error pre {
	white-space: pre-wrap;
	max-height: calc(100% - 150px);
	overflow: scroll;
}

.mqm-login {
	margin: calc(50vh - 120px) auto;
	text-align: center;
	font-family: Arial, sans-serif;
.text--sm;
	line-height: 24px;
	color: #555;
}

@keyframes mf-logo-loading-animation-1 {
	0% {
		opacity: 0;
		transform: rotate3d(0, 1, 0, 90deg);
	}
	20% {
		opacity: 1;
		transform: scale(1) rotate3d(0, 0, 0, 0);
	}
	60% {
		opacity: 1;
		transform: scale(1) rotate3d(0, 0, 0, 0);
	}
	90% {
		opacity: 0;
		transform: rotate3d(0, 0, 0, 0);
	}
	100% {
		opacity: 0;
		transform: rotate3d(0, 0, 0, 0);
	}
}

@keyframes mf-logo-loading-animation-2 {
	0% {
		opacity: 0;
		transform: rotate3d(1, 0, 0, 90deg);
	}
	20% {
		opacity: 1;
		transform: scale(1) rotate3d(0, 0, 0, 0);
	}
	60% {
		opacity: 1;
		transform: scale(1) rotate3d(0, 0, 0, 0);
	}
	90% {
		opacity: 0;
		transform: rotate3d(0, 0, 0, 0);
	}
	100% {
		opacity: 0;
		transform: rotate3d(0, 0, 0, 0);
	}
}

.loading-anim {
	height: 100px;
}

.loading-anim__mf-logo__container {
	position: relative;
	display: inline-block;
	width: 100px;
	height: 100px;
}

.loading-anim__mf-logo__part {
	position: absolute;
	background: #0073e7;
	animation-duration: 2.2s;
	animation-timing-function: ease;
	animation-iteration-count: infinite;
	will-change: opacity, transform;
}

.loading-anim__mf-logo__part:nth-child(1) {
	width: 81px;
	height: 19px;
	top: 0;
	right: 0;
	transform-origin: 0 50%;
	animation-name: mf-logo-loading-animation-1;
	animation-delay: 0s;
}

.loading-anim__mf-logo__part:nth-child(2) {
	width: 19px;
	height: 62px;
	top: 19px;
	right: 0;
	transform-origin: 100% 0;
	animation-name: mf-logo-loading-animation-2;
	animation-delay: 0.1s;
}

.loading-anim__mf-logo__part:nth-child(3) {
	width: 81px;
	height: 19px;
	bottom: 0;
	left: 0;
	transform-origin: 100% 0;
	animation-name: mf-logo-loading-animation-1;
	animation-delay: 0.2s;
}

.loading-anim__mf-logo__part:nth-child(4) {
	width: 19px;
	height: 62px;
	bottom: 19px;
	left: 0;
	transform-origin: 0 100%;
	animation-name: mf-logo-loading-animation-2;
	animation-delay: 0.3s;
}

/*do not remove used in loading message*/
.mqm-login--connect-msg {
	white-space: nowrap;
	overflow: hidden;
	text-overflow: ellipsis;
	animation: fadeinloadingtext 0.5s;
}

@keyframes fadeinloadingtext {
	from {
		opacity: 0;
	}
	to {
		opacity: 1;
	}
}

	0% {

	100% {
		transform: rotate(360deg);
